import image1 from './../../images/js-card.jpeg';
import image2 from './../../images/js2.jpeg';
import image4 from './../../images/js4.jpeg';
import image3 from './../../images/javascript.jpeg';

const jsCards = [
    {
      type: "js",
      num: 1,
      image: image1,
      class: "Beginners for JavaScript",
      description:
        "Kevin Chisholm",
      hours: "$25",
    },
    {
      type: "js",
      num: 2,
      image: image2,
      class: "Learn with me ",
      description:
        "John Snow",
        hours: "$25",
      },
    {
      type: "js",
      num: 3,
      image: image3,
      class: "Learn JS A to Z",
      description:
        "Rob Merrill",
        hours: "$25",
      },
    {
      type: "js",
      num: 4,
      image: image4,
      class: "Learn Modern JavaScript ",
      description:
        "Steven Hancock",
        hours: "$25",
      },
  ];
  export default jsCards;
